import React, { useEffect, useState } from 'react';
import axiosInstance from './api/axios'; // Import axios instance for API calls

const OwnerProperties = () => {
    const [properties, setProperties] = useState([]);
    const [errorMessage, setErrorMessage] = useState('');

    // Fetch properties when component mounts
    useEffect(() => {
        const fetchProperties = async () => {
            try {
                const storedUser = JSON.parse(localStorage.getItem('user')); // Retrieve user object from localStorage
                const ownerEmail = storedUser ? storedUser.email : null; // Get the owner's email from localStorage
                
                if (ownerEmail) {
                    const response = await axiosInstance.get(`properties/owner/${ownerEmail}`); // Fetch properties using email
                    setProperties(response.data);
                    console.log('Fetched properties:', response.data); // Add more logging to track the response
                } else {
                    setErrorMessage('Owner email not found.');
                    console.log('Owner email not found in localStorage.');
                }
            } catch (error) {
                setErrorMessage('Error fetching properties');
                console.error('Error fetching properties:', error);
            }
        };

        fetchProperties(); // Call the function to fetch properties on mount
    }, []);

    return (
        <div className="container mx-auto py-10">
            <h1 className="text-4xl font-bold mb-6">Your Listed Properties</h1>

            {errorMessage ? (
                <div className="text-red-500">{errorMessage}</div>
            ) : (
                <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
                    {properties.map((property) => (
                        <div key={property._id} className="bg-white p-6 shadow rounded-lg">
                            <h2 className="text-xl font-bold">{property.address}</h2>
                            <p>Rent: ${property.rent}</p>
                            <p>Deposit: ${property.deposit}</p>
                            <button
                                className="bg-green-500 text-white mt-4 py-2 px-4 rounded"
                                onClick={() => alert(`Viewing details of ${property._id}`)}
                            >
                                View Details
                            </button>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default OwnerProperties;
